  const getOffer = async () => {
    await axios
      .post("http://bootcampapi.techcs.io/api/fe/v1/product/offer/8ZCjpyKZvrUZFn7HevtT'")
      .then((data) => setOfferedData(data))
      .catch((err) => console.log(err));
  };

  useEffect(() => {
    getOffer();
  }, []);

  console.log({ offeredData });
  return (
    <div>
      <h1>this is a test component</h1>
    </div>
  );
}

export default TestComponent;
